import React, { Component } from 'react'
import labeledt from '../svg_icons/label_edit.svg'
import deleteIcon from '../svg_icons/delete.svg'
import labelIcon from '../svg_icons/label.svg'
import { InputBase } from '@material-ui/core';


export default class DialogLabelEdit extends Component {




    handleMouse=()=>{
        this.setState({
            isHover:true
        })
    }

    handleMouseLeave=()=>{
        this.setState({
            isHover:false
        })
    }
    render() {
        return (
            <div onMouseEnter={this.handleMouse} onMouseLeave={this.handleMouseLeave} className="DialogNote" id="DialogNote" key={this.props.label.id}>
                {this.state.isHover ? <img src={deleteIcon} onClick={this.deleteLabel} alt="deletesvg" />
                    : <img src={labelIcon} alt="labelsvg" />}
                <p>{this.props.label.name}</p>
                <div className="DgEditLabel" >
                    {this.state.renameLabel ? <InputBase defaultValue />
                        : <img onClick={this.handleLblEdit} src={labeledt} alt="labelsvg" />
                    }
                </div>
            </div>
        )
    }
}
